import React from 'react';
import { withRouter } from "react-router";

function ShowEmployee({shownEmployee, history}) {

    const HandleClick = () => {
        history.push("/employees")
    }


    return(
        <div id="shownemployee">
            <button id="backbutton" onClick={HandleClick}>Tilbage</button>
            <div id="allmachineattributes">
                <div className="machineattributes">
                    <h1 className="showmachineh1">Maskine nr.</h1>
                    <p>Test{/*shownEmployee["employeeId"]*/}</p>
                </div>
                <div className="machineattributes">
                    <h1 className="showmachineh1">Pumpe navn</h1>
                    <p>Test{/*shownEmployee["employeeName"] == null ? "Ingen pumpe" : shownEmployee["employeeName"]*/}</p>
                </div>
                <div className="machineattributes">
                    <h1 className="showmachineh1">Tid tilbage</h1>
                    <p>
                        {shownEmployee["employeeAddress"] == null ? "Ingen tid" : shownEmployee["employeeAddress"]}
                    </p>
                </div>
            </div>
        </div>
    )
}
export default withRouter(ShowEmployee);
